import {DisplayedObject} from './displayedObject';
import {EditableObject} from './editableObject';
export class TableCell {
    private objects: Array<DisplayedObject> | EditableObject;
    private style: string;

    constructor(objects: Array<DisplayedObject> | EditableObject, style?: string) {
        this.objects = objects;
        this.style = style;
    }

    getObjects() {
        return this.objects;
    }

    getStyle() {
        return this.style;
    }
}
